import React from 'react';
import '../styles.css';
import Footer from '../Components/Footer';
import Product from '../products.json'


class Products extends React.Component {
    constructor() {
        super();
        this.state = {
            products: Product,
        }
    }
    createProducts() {
        //products=array
        const products = this.state.products;
        console.log(products);
        products.map((product) => {
            console.log(product);
        })
    }
    render() {
        return (
            <div>
                <div className="productsPage">
                    <h2>THE STASH</h2>
                    <p className="ShopMens">Shop Men's </p>
                    {this.createProducts()}
                    <div className="card" style={{width : '18rem'}}>
                        <div className="work-img">
                            <a href="ShopMens"><img class="card-img-top img-fluid" src="https://www.pacsun.com/dw/image/v2/AAJE_PRD/on/demandware.static/-/Sites-pacsun_storefront_catalog/default/dwffe516c2/product_images/0097503380408NEW_00_054.jpg?sw=690&sh=1070&sm=fit" alt="pacsun huf shirt"/></a>
                            <div className="img-overlay"></div>
                        </div>
                        <div className="card-body">
                            <p>HUF Alameda Striped T-Shirt</p>
                            <ul className="card-text">
                                <li>$35</li>
                                <li>This rad tee has a classic everyday construction, bold multicolor stripes all over, and an embroidered HUF logo at the left chest.</li>
                            </ul>
                        </div>
                    </div>
                </div>
                    <div className="row text-center">
                        <div className="col-md-3 col-sm-6 wow fadeInUp card-container" data-wow-delay="0.3s">
                        <p className="ShopWomens">Shop Women's </p>
                            <div className="card" style={{width : '18rem'}}>
                                <div className="work-img">
                                <a href="#"><img className="card-img-top img-fluid" src="https://www.pacsun.com/dw/image/v2/AAJE_PRD/on/demandware.static/-/Sites-pacsun_storefront_catalog/default/dw51af07ff/product_images/0702513380045NEW_01_108.jpg?sw=458&sh=710&sm=fit" alt="women pacsun shirt"/></a>
                                    <div className="img-overlay"></div>
                        </div>
                                    <div className="card-body">
                                        <p className="card-text2">Guess Pomona Stripe T-Shirt</p>
                                        <ul className="card-text">
                                            <li>$39.00 Now $27.30</li>
                                            <li>30% off savings</li>
                                            <li>This ultra-cool tee features short sleeves, crew neckline, logo embroidery at the chest, and a relaxed fit.</li>
                                        </ul>
                                    </div>
                                </div>
                            </div>
                    </div>
                </div>
        );
    }
}
export default Products;
